// @ts-ignore
import { analyze } from '../../../utils/rgbaster';

onmessage = e => {
  console.log('Worker received:', e.data);
  if (process.browser) {
    const colors = analyze(e.data);
    if (colors[0]) {
       // @ts-ignore
      postMessage(colors[0].color);
    }
    console.log('I am on browser');
  }
};
